  false,\n\t\"url\": null,\n\t\"notes\": \"A proposal sent to the Richard King Mellon
  Foundation for a loan to fund the purchase of Ash Meadows by the Nature Conservancy.
  Ash Meadows, set outside of Las Vegas Nevada, is home to a number of threatened
  and endangered desert species. Its unique ecosystem provides habitat to a number
  of plants and animals. In an effort to protect the land the Nature Conservancy is
  seeking to purchase the land with aid from the Richard King Mellon Foundation.\",\n\t\"owner_org\":
